import React, { Component }from 'react';
import axios from 'axios';
import { List } from 'antd';
// import

class ListItem extends Component{



constructor(props){
    super(props)
    this.state={
        data:[]
    }
}

componentDidMount(){
    axios.get('')
    .then(res=>{
        console.log(res)
    })
}


render(){
    return (
        <List
     
      bordered
      dataSource={this.state.data}
      renderItem={item => (
        <List.Item>
          {item}
        </List.Item>
      )}
    />
    )
}
}
export default ListItem;
